import React from 'react';
import { Box, Typography, Paper } from '@mui/material';

interface City {
  name: string;
  region: string;
  latitude: number;
  longitude: number;
  population: number;
}

interface MigrationMapProps {
  cities: City[];
}

const MigrationMap: React.FC<MigrationMapProps> = ({ cities }) => {
  return (
    <Box>
      <Typography variant="h5" gutterBottom>
        Карта міграції
      </Typography>
      <Paper sx={{ p: 2, height: '500px', display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
        <Typography variant="body1" color="text.secondary">
          Карта міграції буде додана пізніше
        </Typography>
      </Paper>
    </Box>
  );
};

export default MigrationMap;
